import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TelecomPack = () => {
  const [telecomPacks, setTelecomPacks] = useState([]);

  useEffect(() => {
    const fetchTelecomPacks = async () => {
      const response = await axios.get('/api/telecom-packs');
      setTelecomPacks(response.data);
    };

    fetchTelecomPacks();
  }, []);

  return (
    <div className="telecom-pack">
      <h1>Telecom Packs</h1>
      <ul>
        {telecomPacks.map((pack) => (
          <li key={pack.id}>{pack.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default TelecomPack;
